import './App.css';
import React, {useState} from "react";
import axios from "axios";
import {stringify} from "jest-matcher-utils";

function App() {

    const [getAllCourses, setGetAllCourses] = useState([]);
    const [degreeName, setDegreeName] = useState("");
    axios.get('http://localhost:8081/getAllCourses')
        .then(res => {
            setGetAllCourses(res.data)
        });

    function fixDegreeName(event) {
//        event.preventDefault();
        setDegreeName(event.target.getAttribute('name').replace(/ /g, ''));
        window.location.href = degreeName;
        console.log('hello' + degreeName);
    }

    return (<div>
            {getAllCourses.map((eachCourse, index) => <div key={index}>
                <div id={"studyProgram-" + index}>
                    <div id={"deptName-" + index}><h5>{eachCourse.deptName}</h5><span></span></div>
                    <div id={"degreeName-" + index} name={eachCourse.crawledCourses.degreeName} onClick={fixDegreeName}>
                        test
                    </div>

                    <div id={"degreeName-" + index} className="degreeName" data-toggle="modal"
                         data-target="#myModal">{eachCourse.crawledCourses.degreeName}<span></span></div>
                    <div id={"degreeType-" + index}><span>{eachCourse.degreeType}</span></div>
                    <div id={"language-" + index}><span>{eachCourse.crawledCourses.language}</span></div>
                    <div id={"uniName-" + index}><a href={eachCourse.crawledCourses.website}
                                                    target="_blank">{eachCourse.crawledCourses.uniName}</a><span></span>
                    </div>
                </div>


            </div>)}
        </div>
    );

}

export default App;
